import React, { useState } from "react";
import NewExercise from "./NewExercise";
import AddIcon from '@mui/icons-material/Add';

export default function AddWorkout() {

    let num = 0

    const [exerciseList, setExerciseList] = useState([<NewExercise key={num}/>])

    function onClick() {
        num += 1
        setExerciseList([...exerciseList, <NewExercise key={num}/>])
    }

    return (
        <>
            <table className='exercise-table'>
                <tbody>
                    <tr>
                        <th>Exercise</th>
                        <th>Weight</th>
                        <th>Reps</th>
                    </tr>
                    {exerciseList}
                </tbody>
            </table>
            <AddIcon onClick={onClick} />
        </>
    )
}
